export default {
  GET_ALL_USER(state, data){
    state.users = data
  },
  SET_USER(state, data) {
    state.currentUser = data
  },
  RESET_USER(state) {
    state.currentUser = ''
  },
  SET_PROFILE(state, profile) {
    state.profile = profile
  },
  SET_PASSWORD(state) {
    state.profile
  },
  RESET_PROFILE(state) {
    state.profile = null
  },
};
